import React,{useRef,useState,useEffect} from 'react';
import logo from './logo.svg';
import './App.css';
import './style.css'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect
} from "react-router-dom";
import Home from './pages/Home'

export default class App extends React.Component {
  render() {
    return (
      <Router>
        <Switch>
            <Route path="/">
                <Home/>
            </Route>
        </Switch>
      </Router>
    );
  }

}
